Teaser:
برنامه های C/C++ خود را در ChATGPT با استفاده از این دستور اجرا کنید. این یک دستور بسیار قدرتمند برای اجرای انواع زبان های برنامه نویسی به طور مستقیم در مرورگر وب خود با استفاده از Chatgpt است.

 فقط کد C یا C++ خود را که می‌خواهید اجرا کنید در اعلان تایپ کنید و Chat-GPT خروجی آن برنامه را در پاسخ به شما می‌دهد.

 اگر کامپایلری در رایانه شخصی خود نصب ندارید و می خواهید کدی را آزمایش کنید، اکنون می توانید با یک اعلان ساده این کار را انجام دهید، این کار مفید است.

 مثال برای کد ++C.
 #include <Istream>

 int main() {
  std::cout << "Hello chat-gpt3" << std::endl;
  بازگشت 0;
 }
